import * as React from 'react';
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import CssBaseline from '@mui/material/CssBaseline';
import TextField from '@mui/material/TextField';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import Link from '@mui/material/Link';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import LockOutlinedIcon from '@mui/icons-material/LockOutlined'
import Container from '@mui/material/Container';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { Link as RouterLink } from 'react-router-dom';
import Typography from '@mui/material/Typography';

// TODO remove, this demo shouldn't need to reset the theme.

const defaultTheme = createTheme();

export default function SignIn() {
  const handleSubmit = (event) => {
    event.preventDefault();
    const data = new FormData(event.currentTarget);
    console.log({
      email: data.get('email'),
      password: data.get('password'),
    });
  };

  return (
    <section>
    <ThemeProvider theme={defaultTheme}>
      <Container component="main" maxWidth="md">
        <CssBaseline />
        <Box
          sx={{
            marginTop: 8,
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            width: '100%', 
            maxWidth: '2600px',
          }}
        >
          <Avatar sx={{ m: 1, bgcolor: 'secondary.main', width: 180, height: 180 }}>
            <LockOutlinedIcon sx={{ fontSize: 80 }} /> 
          </Avatar>

          <Typography component="h1" variant="h5" style={{ fontSize: '8rem' }}>
            Sign in
          </Typography>

          <Box component="form" onSubmit={handleSubmit} noValidate xl={{ mt: 1 }}>
            <TextField
              margin="normal"
              required
              fullWidth
              id="email"
              label="Email Address"
              name="email"
              autoComplete="email"
              autoFocus
              InputProps={{
                style: {
                  fontSize: '3rem', 
                  padding: '15px 10px', 
                },
              }}
              InputLabelProps={{
                style: {
                  fontSize: '3rem', 
                },
              }}
              sx={{
                '& fieldset': {
                  borderWidth: '3px',
                },
              }}
            />

            <TextField
              margin="normal"
              required
              fullWidth
              name="password"
              label="Password"
              type="password"
              id="password"
              autoComplete="current-password"
              InputProps={{
                style: {
                  fontSize: '3rem', 
                  padding: '15px 14px', 
                  borderRadius: '4px', 
                },
              }}
              InputLabelProps={{
                style: {
                  fontSize: '3rem', 
                },
              }}
              sx={{
                '.MuiOutlinedInput-root': {
                  '& fieldset': {
                    borderWidth: '2px',
                  },
                  '&:hover fieldset': {
                    borderWidth: '2px', 
                  },
                  '&.Mui-focused fieldset': {
                    borderWidth: '2px', 
                  },
                },
                marginBottom: '20px', 
              }}
            />


            <FormControlLabel
              control={
                <Checkbox
                  value="remember"
                  color="primary"
                  sx={{
                    '& .MuiSvgIcon-root': {
                      fontSize: '3rem', 
                    },
                  }}
                />
              }
              label="Remember me"
              sx={{
                '& .MuiTypography-root': { 
                  fontSize: '3rem', 
                },
              }}
            />

            <Button
              type="submit"
              fullWidth
              variant="contained"
              sx={{
                mt: 3,
                mb: 2,
                fontSize: '3rem', 
                padding: '12px 0', 
                minHeight: '50px', 
              }}
            >
              Sign In
            </Button>

            <Grid container justifyContent="space-between">
              <Grid item>
                {/* Use RouterLink here for Forgot password */}
                <Link component={RouterLink} to="/ForgotPassword" variant="body2" sx={{ fontSize: '3rem', padding: '8px' }}>
                  Forgot password?
                </Link>
              </Grid>
              <Grid item>
                {/* Use RouterLink here for Sign Up */}
                <Link component={RouterLink} to="/SignUp" variant="body2" sx={{ fontSize: '3rem', padding: '8px' }}>
                  {"Don't have an account? Sign Up"}
                </Link>
              </Grid>
            </Grid>



          </Box>
        </Box>
      </Container>
    </ThemeProvider>
    </section>
  );
}
